int getDocIdSetSize(DocIdSet docIdSet) throws Exception {
  int size = 0;
  DocIdSetIterator it = docIdSet.iterator();
  while (it.next()) {
    size++;
  }
  return size;
}

int getDocIdSetSize(DocIdSet docIdSet) throws Exception {
  int size = 0;
  DocIdSetIterator it = docIdSet.iterator();
  while (it.nextDoc() != DocIdSetIterator.NO_MORE_DOCS) {
    size++;
  }
  return size;
}

